import "../App.css"
import "./About.css"

export default function About() {
    return(
        <div className="page">
            <p id="bio">Hi! I'm tranquilturtle781. I'm a junior at Brown University studying Applied Mathematics and Computer Science.</p>
            <img id="profilepic" src="turtle.png"></img>
        </div>
    )
}
